import React, { Component } from 'react';

class Habbit extends Component {
  render() {
    return (
      <li>
        <span className ="habbit-name">Reading</span>
        <span className ="habbit-count">0</span>
        <button className ="habbit-button habbit-increase">
          <i className="fas fa-plus"></i>
        </button>
        <button className ="habbit-button habbit-decrease">
          <i className="fas fa-minus"></i>
        </button>
        <button className ="habbit-button habbit-delete">
          <i class="fas fa-trash"></i>
        </button>
      </li> 
    );
  }
}

export default Habbit;
